import React, { useState, useEffect } from 'react';

function BusinessInsights() {
  const [restaurantData, setRestaurantData] = useState([]);
  const [searchPhone, setSearchPhone] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [restaurantsPerPage] = useState(6);

  useEffect(() => {
    fetch('/api/restaurantData')
      .then(response => response.json())
      .then(data => setRestaurantData(data))
      .catch(error => console.error('Error fetching restaurant data', error));
  }, []);

  // Filter restaurants based on the entered phone number
  const filteredRestaurants = restaurantData.filter(restaurant =>
    restaurant.phoneNumber.includes(searchPhone)
  );

  // Logic for displaying restaurants
  const indexOfLastRestaurant = currentPage * restaurantsPerPage;
  const indexOfFirstRestaurant = indexOfLastRestaurant - restaurantsPerPage;
  const currentRestaurants = filteredRestaurants.slice(
    indexOfFirstRestaurant,
    indexOfLastRestaurant
  );

  // Change page
  const paginate = pageNumber => setCurrentPage(pageNumber);

  return (
    <div className="mt-7 text-center">
      <h2 className="text-2xl font-bold mb-4">All businesses</h2>
      <h1>Monitor sales and status</h1>
      <div className="mb-4 flex justify-end">
        <div className="relative" style={{ marginRight: '340px' }}>
          <input
            type="text"
            placeholder="Search by Phone"
            value={searchPhone}
            onChange={e => setSearchPhone(e.target.value)}
            className="border rounded px-3 py-2 pl-10" // Increased left padding to accommodate the icon
          />
          <div className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-500">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              viewBox="0 0 24 24"
              width="20" // Reduced icon size for better alignment
              height="20" // Reduced icon size for better alignment
              fill="none"
              stroke="currentColor"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
              className="feather feather-search"
            >
              <circle cx="11" cy="11" r="8" />
              <line x1="21" y1="21" x2="16.65" y2="16.65" />
            </svg>
          </div>
        </div>
      </div>
      <table className="border-collapse mx-auto rounded-lg overflow-hidden">
        <thead>
          <tr>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Restaurant Name</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Cuisine Type</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Phone Number</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Longtitude</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Latitude</th>
            <th className="border px-4 py-2 bg-yellow-300 text-white">Delivery Distance</th>
          </tr>
        </thead>
        <tbody>
          {currentRestaurants.map(restaurant => (
            <tr key={restaurant.id}>
              <td className="border px-4 py-2 text-black">{restaurant.restaurantName}</td>
              <td className="border px-4 py-2 text-black">{restaurant.cuisineType}</td>
              <td className="border px-4 py-2 text-black">{restaurant.phoneNumber}</td>
              <td className="border px-4 py-2 text-black">{restaurant.longtitude}</td>
              <td className="border px-4 py-2 text-black">{restaurant.latitude}</td>
              <td className="border px-4 py-2 text-black">{restaurant.deliveryDistance}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="flex justify-center mt-4">
        <button
          onClick={() => paginate(currentPage - 1)}
          disabled={currentPage === 1}
          className="mr-4 bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
        >
          Previous Page
        </button>
        {Array.from({ length: Math.ceil(filteredRestaurants.length / restaurantsPerPage) }, (_, i) => (
          <button
            key={i}
            onClick={() => paginate(i + 1)}
            className={`mr-4 bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded ${
              currentPage === i + 1 ? 'bg-blue-700' : ''
            }`}
          >
            {i + 1}
          </button>
        ))}
        <button
          onClick={() => paginate(currentPage + 1)}
          disabled={currentPage === Math.ceil(filteredRestaurants.length / restaurantsPerPage)}
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
        >
          Next Page
        </button>
      </div>
    </div>
  );
}

export default BusinessInsights;
